import React from 'react';

import '../src/styles/styles.scss';

import Home from './components/01_pages/Home';

function App() {
  return (
    <div className="App">
      <Header />
      <RightFixed />
      <About />
      <Portfolio />
      <Experience />
      {/* <Contact /> */}
      <Footer />
    </div>
  );
}

export default App;
